import React from "react";

const Products = () => {
  const products = [
    { id: Math.random.toString(), name: "a book" },
    { id: Math.random.toString(), name: "a carpet" },
    { id: Math.random.toString(), name: "a glas" },
  ];
  return (
    <>
      <ul>
        <li>Book </li>
        <li>Carpet</li>
        <li>Online course</li>
      </ul>
    </>
  );
};

export default Products;
